import React from 'react';
import './SkillsBlurb.css'

const SkillsBlurb = (props) => {
    return (
        <div>
            <p className='blurb__content'>My name is Filip. I am a 30 year old Polish guy currently residing in Cork, Ireland. I am aspiring to become a Front End developer by learning different technologies along my way. This simple page is just a repository for all of my projects from the beginning of my coding journey.</p>
        </div>
    );
}

export default SkillsBlurb;
